import React from 'react'
import {Footer, Blog, Possibility, Features, About, Header} from './containers';
import {CTA, Brand, Navbar} from './containers';
import './App.css';

const App = () => {
  return (
    <div className='App'>
      <div className='gradient_bg'>
        <Navbar/>
        <Header/>
      </div>
        <Brand/>
        <About/>
        <Features/>
        <Possibility/>
        <CTA/>
        <Blog/>
        <Footer/>
    </div>
  )
}

export default App
